import React, { Component } from "react";
import "./List.css";

// function, class  //function으로 바꾸기.
// state 여부 

function List() {
        return (
            <span className = "list">
                <input 
                    type = "checkbox"
                    value = {this.props.name}
                    name = "isChecked"
                    onChange = {this.handleChecked}>
                </input>
                <label>{this.props.name}</label>
            </span>
        );

}

export default List
